import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, View, SafeAreaView, ScrollView, Dimensions, Image } from 'react-native';
import { TabHeader, AppBody, BuySell, TestComp } from './components/zzindex.jsx';
const { height,width } = Dimensions.get('window');

export default function App() {
  return (
    <SafeAreaView style={styles.container}>
      <ScrollView scrollEnabled={false}>

        <View style={styles.wrapper}>
          <TabHeader style={styles.header} />
          <View style={styles.body}>
            <Image style={styles.event} source={require('./assets/event.jpg')} resizeMode='stretch'/>

            <AppBody />
          </View>
          <View style={styles.footer}>
            <BuySell />
          </View>
        </View>

      </ScrollView>
      <StatusBar style='auto' />
    </SafeAreaView>

  );
}

const styles = StyleSheet.create({
  container: {
    // backgroundColor: '#fff',
    width: width,
    height: height,
  },
  event: {
    backgroundColor: 'red',
    width: width,
    height: height*0.075,
  },
  header: {
    // backgroundColor: 'blue',
  },
  body: {
    // backgroundColor: 'gray',
  },
  footer: {
    // backgroundColor: 'lightblue',
  },
});
